  );
}

const styles = {
  page: {
    minHeight: "70vh",
        marginTop:"40px", 
    display: "flex",
    justifyContent: "center",
    background: "#ffffffff",
    fontFamily: "'Poppins', sans-serif",
  },

  card: {
    width: "100%",
    maxWidth: "1000px",
    background: "#ffffff",
    borderRadius: "20px", 
    padding: "30px",
    boxShadow: "0 8px 20px rgba(0,0,0,0.3)",
  },

  heading: {
    textAlign: "center",
    color: "#2E7D32",
    fontSize: "28px",
    marginBottom: "30px",
    fontWeight: "700",
  },

  noData: {
    textAlign: "center",
    color: "#1B5E20",
    fontSize: "18px",
    padding: "25px",
    borderRadius: "15px",
    background: "rgba(200, 230, 201, 0.3)",
    fontWeight: "600",
  },

  tableContainer: {
    overflowX: "auto",
    borderRadius: "12px",
    boxShadow: "0 4px 12px rgba(0,0,0,0.05)",
  },

  table: {
    width: "100%",
    borderCollapse: "separate",
    borderSpacing: "0 10px",
    fontSize: "18px",
    textAlign: "left",
  },

  thead: {
    backgroundColor: "#C8E6C9",
    fontWeight: "700",
    fontSize: "17px",
  },

  rowEven: {
    backgroundColor: "#ffffff",
    borderBottom: "1px solid #d0d0d0",
  },

  rowOdd: {
    backgroundColor: "#f0fff0",
    borderBottom: "1px solid #d0d0d0",
  },

  cell: {
    padding: "12px 10px",
    fontSize: "17px",
  },
};

export default HistoryPage;
